&amp;#039;Hua kaew? is in kindergarten 3/2 is the leader of the pack in persuading all the boys and girls of his class to compete in the 18th National tug of war competition. Other than not knowing where the competition is being held, what the dates are, and how many competitors per team are competing, he brings much trouble to teacher Noo Lek who has to become the manager of the team. Mr. Bird, a football coach in a Thai league was the another fish who fell for the bait, having to come and help the kids in the tug of war competition. Trouble begins as the children?s parents start to wanting to have say in decision-making which causes a lot of head-butting within the team. From the leader of the pack ?Hua Kaew? becomes only a substitute but in the end ?dream team? has been able to fight through many obstacles.

